              <div id="emptyStateMessage" class="rowAuto primaryText">
                Looks like there are no symbols (with the same name) to merge. Awesome!
              </div>

            </div>
          </div>
        </div>
      </div>
    </div>
    <div class="rowAuto bottomBar">
      <div id="actionsRow" class="horizontalLayout actionsRow">
        <div class="colAvailable">
          <div id="chkLibraries" class="roundCheckbox notDisplayed">
            <input type="checkbox" id="chkIncludeLibraries" checked />
            <label for="chkIncludeLibraries">
              <span id="lblIncludeLibraries" class="longLabel">Include all enabled libraries symbols</span>
            </label>
          </div>
        </div>
        <div class="colAuto">
          <button id="btnCancel" class="btnSecondary notDisplayed">Cancel</button>
        </div>
        <div class="colAuto">
          <button id="btnMerge" class="btnPrimary" disabled>Merge symbols</button>
          <button id="btnOK" class="btnPrimary notDisplayed">Close</button>
        </div>
      </div>
    </div>
    <div class="draggableArea alignFullCenter" data-app-region="drag"><span id="windowTitle">Merge duplicate
        symbols</span></div>
  </div>
  <!-- notice the "../" here. It's because webview.js will be compiled in a different folder -->
  <script src="../resources_mergeduplicatesymbols.js"></script>
  <script src="../resources_progressRing.js"></script>
</body>

</html>
